import React, { Component } from 'react';

class Chat extends Component {
  constructor(props) {
    super(props);

    this.state = {
      messages: []
    }
  }

  render() {
    return (
    <div>
      <div className="mainChat">
        <div className="message botChat">hello from bot</div>
        <div className="message humanChat">hello from bot</div>
      </div>
      <div class="input">
        <input type="text"/>
        <button>Send</button>
      </div>
    </div>
    )
  }
}

export default Chat;
